import { Component } from '@angular/core';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css'],
})
export class RegisterComponent {
  user = {
    name: '',
    tipoDocumento: '',
    numDocumento: 0,
    password: '',
  };

  userRegister() {
    console.log(this.user);
  }
}
<h4>Registrate!</h4>

<div>
  <form (submit)="userRegister()">
    <div>
      <label>Nombre:</label>
      <input type="text" name="name" [(ngModel)]="user.name" />
    </div>

    <div>
      <label>Tipo de documento:</label>
      <input type="text" name="tipoDocumento" [(ngModel)]="user.tipoDocumento"/>
    </div>

    <div>
      <label>Numero de documento:</label>
      <input type="number" name="numDocumento" [(ngModel)]="user.name"/>
    </div>

    <div>
      <label>Contraseña:</label>
      <input type="password" name="password" [(ngModel)]="user.name"/>
    </div>

    <button type="submit">Registrarme</button>
  </form>
</div>

<a routerLink="/login">Ir al login</a>
